import ImgLogo from "../img/logo512.png";

export const TailWindCss = () => {
  return (
    <div>
      <div
        className="bg-slate-600   p-8 drop-shadow-4xl hover:drop-shadow-xl rounded-tl-full rounded-br-full hover:rounded-tr-full transition-all duration-500 ease-in-out
       flex flex-col
        md:flex-row justify-around    "
      >
        <img
          src={ImgLogo}
          width={20}
          height={20}
          alt="Nothing Here"
          className=" m-auto sm:m-auto md:m-0 lg:m-0    w-20 "
        />
        <p className=" text-slate-50 text-center sm:text-center md:text-center lg:text-center  w-32 ">
          My Ffirst
        </p>
      </div>
    </div>
  );
};
